import "./Home.css";

import logo from "../../assets/Logo.svg";
import { Image, Row, Col, Container } from "react-bootstrap";

import React from "react";

function Home() {
	return (
		<Container fluid>
			<Row>
				<Col className="justify-content-center">
					<Image
						fluid
						src={logo}
						className="w-35 text-center"
					></Image>
				</Col>
				<Col>
					<h1>jldfl</h1>
				</Col>
			</Row>
		</Container>
	);
}

export default Home;
